import React from "react";
import { List, Card, Avatar } from "antd";

export default function technologies() {
  const data = [
    {
      title: "Title 1",
      src: "./blockchain.jpg"
    },
    {
      title: "Title 2"
    },
    {
      title: "Title 3"
    },
    {
      title: "Title 4"
    },
    {
      title: "Title 5"
    },
    {
      title: "Title 6"
    }
  ];
  return (
    <div>
      <List
        grid={{
          gutter: 16,
          xs: 1,
          sm: 2,
          md: 4,
          lg: 4,
          xl: 6,
          xxl: 3
        }}
        dataSource={data}
        renderItem={item => (
          <List.Item>
            <Card title={item.title}>Card content</Card>
            <Avatar
              shape="square"
              size={64}
              src="https://miro.medium.com/max/1104/1*6bOXOdSXtre9t7aMgTr-4A.png"
            />
          </List.Item>
        )}
      />
    </div>
  );
}
